webpackJsonp([0x81b8806e4260],{569:function(e,t){e.exports={data:{authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{nodes:[{node:{frontmatter:{title:"Introducing Drank",tags:["app","drank","drink","Glass Umbrella","health"],cover:"/images/get-drank-banner.jpg",date:"2018-07-14T11:03",author:"eddie"},fields:{slug:"/introducing-drank"},html:'<p>How much Caffeine did you drink yesterday? How many units of alcohol did you consume last weekend? Did you drink enough water today? The answer to these questions for a lot of people is often too much of the bad stuff, and not enough of the good stuff.</p>\n<p><img src="/images/drank-woman-drink.png" alt="Woman using the Drank app"></p>\n<p>Using <a href="https://itunes.apple.com/gb/app/drank/id1224749685?mt=8&#x26;ct=eddieleeme">the Drank app</a> over the last few months has allowed me to improve the balance of what I drink. I knew I drank a lot of caffeine, but until I saw it charted in Drank I wasn’t aware it was over 80% of my daily water intake, sometimes drinking in excess of 10 cups a day.</p>\n<p>Today we’re proud to release Drank to the world!</p>\n<p>Give Drank a go. Gain insights, and drink better.</p>\n<p>Available now for iOS and coming soon for Android.</p>\n<p><a href="https://itunes.apple.com/gb/app/drank/id1224749685?mt=8&#x26;ct=eddieleeme"><img src="/images/download-app-store.png" alt="Download on the App Store"></a></p>',timeToRead:1}},{node:{frontmatter:{title:"Fathers Day",tags:["personal","family"],cover:"/images/fathers-day-banner.jpg",date:"2018-06-17T22:44",author:"eddie"},fields:{slug:"/fathers-day"},html:'<p>Fathers Day in so many respects is such contrived bullshit; but I love it. Not for gifts or a lazy day - for little things, like the kids running in to wake me up; making sure I haven\'t forgotten it\'s Fathers Day. Bringing me handmade cards, funny cards, personalised gifts, and fun activities to do together.</p>\n<p>Fathers Day is great!</p>\n<p>This photo frame really made my day!\n<img src="/images/fathers-day-photo-frame.jpg" alt="Fathers Day Photo Frame"></p>\n<table class="image-split">\n    <tr>\n        <td colspan="2">\n            Ethan\'s card to himself is fantastic!\n        </td>\n    </tr>\n    <tr>\n        <td>\n            <img src="/images/fathers-day-ethan-card-1.jpg" alt="Fathers Day Card">\n        </td>\n        <td>\n            <img src="/images/fathers-day-ethan-card-2.jpg" alt="Fathers Day Card Inside">\n        </td>\n    </tr>\n</table>\n<p>Handmade cards really are awesome!!\n<img src="/images/fathers-day-kids-cards.jpg" alt="Fathers Day Cards"></p>\n<p>And I cannot wait to set this hydraulic arm up with Ethan! We\'re going to have so much fun with it!!\n<img src="/images/fathers-day-arm.jpg" alt="Hydraulic Arm"></p>\n<p>My kids are awesome!!</p>',timeToRead:1}},{node:{frontmatter:{title:"Post Traumatic",tags:["music","Post Traumatic","Linkin Park","Mike Shinoda"],cover:"/images/post-traumatic-cover.jpg",date:"2018-06-16T21:01",author:"eddie"},fields:{slug:"/post-traumatic"},html:'<p>The new album; Post Traumatic by Mike Shinoda is absolutely fantastic. Some of his solo work in the past has been pretty good, but every single track on this album is unquestionably excellent!!</p>\n<p>It really fucking sucked when Chester died last year - this album is a very raw show of grief layed out as the album progresses. Well worth a listen...</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 68.18181818181817%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe allow="autoplay *; encrypted-media *;" frameborder="0" sandbox="allow-forms allow-popups allow-same-origin allow-scripts allow-top-navigation-by-user-activation" src="https://embed.music.apple.com/ca/album/post-traumatic/1362650343" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>',timeToRead:1}},{node:{frontmatter:{title:"Simpsons Quotes",tags:["The Simpsons","quotes","tv","media"],cover:"/images/the-simpsons-banner.jpg",date:"2018-06-10T08:01",author:"eddie"},fields:{slug:"/simpsons-quotes"},html:'<p>The latest episode of The Incomparable is fantastic; <a href="https://www.theincomparable.com/theincomparable/410/">episode 410 - I Am Not a Crackpot</a>. It\'s a draft of the best Simpsons Quotes with <a href="https://www.theincomparable.com/person/jason-snell/">Jason Snell</a> with <a href="https://www.theincomparable.com/person/glenn-fleishman/">Glenn Fleishman</a>, <a href="https://www.theincomparable.com/person/philip-michaels/">Philip Michaels</a>, <a href="https://www.theincomparable.com/person/john-siracusa/">John Siracusa</a>, and <a href="https://www.theincomparable.com/person/monty-ashley/">Monty Ashley</a>.</p>\n<p>There are some absolutely classic Simpsons episodes, and many many fantastic quotes (mainly in the first 10 seasons). After listening to this podcast I had to try and put together some of my own favourite Simpsons quotes.</p>\n<p>I tried to do a top 10, so here are 22…</p>\n<p><img src="/images/the-simpsons-quote-1.jpg" alt="The reason we have elected officials is so we don&#x27;t have to think all the time.">\n<em>Bart\'s Comet - S06E14</em></p>\n<p><img src="/images/the-simpsons-quote-2.jpg" alt="Boy, everyone is stupid except me.">\n<em>Homer the Heretic - S04E03</em></p>\n<p><img src="/images/the-simpsons-quote-3.jpg" alt="(Loud Gulp) Ahh! Sweet liquor eases the pain.">\n<em>Bart\'s Inner Child - S05E07</em></p>\n<p><img src="/images/the-simpsons-quote-4.jpg" alt="The most rewarding part was when he gave me my money.">\n<em>The Springfield Files - S08E10</em></p>\n<p><img src="/images/the-simpsons-quote-5.jpg" alt="When she sees you&#x27;ll do anything she says, she&#x27;s bound to respect you.">\n<em>Lisa\'s Date With Density - S08E07</em></p>\n<p><img src="/images/the-simpsons-quote-6.jpg" alt="I&#x27;m a white male, age 18 to 49. Everyone listens to me, no matter how dumb my suggestions are.">\n<em>Lisa vs. Malibu Stacy - S05E14</em></p>\n<p><img src="/images/the-simpsons-quote-7.jpg" alt="But my mom says I&#x27;m cool.">\n<em>Burns\' Heir - S05E18</em></p>\n<p><img src="/images/the-simpsons-quote-8.jpg" alt="What&#x27;s the point of going out? We&#x27;re just gonna wind up back here anyway.">\n<em>Scenes From the Class Struggle in Springfield - S07E14</em></p>\n<p><img src="/images/the-simpsons-quote-9.jpg" alt="Well, it&#x27;s 1am. Better go home and spend some time with the kids.">\n<em>The Springfield Files - S08E10</em></p>\n<p><img src="/images/the-simpsons-quote-10.jpg" alt="Hello, Simpson. I&#x27;m riding the bus today because Mother hid my car keys to punish me for talking to a woman on the phone. She was right to do it.">\n<em>Treehouse of Horror IV - S05E05</em></p>\n<p><img src="/images/the-simpsons-quote-11.jpg" alt="Ah, there&#x27;s nothing more exciting than science. You get all the fun of sitting still, being quiet, writing down numbers, paying attention... Science has it all.">\n<em>Bart\'s Comet - S06E14</em></p>\n<p><img src="/images/the-simpsons-quote-12.jpg" alt="In the area under &#x22;do not write in this space&#x22;, he wrote, &#x22;Okay&#x22;.">\n<em>Lisa the Beauty Queen - S04E04</em></p>\n<p><img src="/images/the-simpsons-quote-13.jpg" alt="In this house, we obey the laws of thermodynamics!">\n<em>The PTA Disbands - S06E21</em></p>\n<p><img src="/images/the-simpsons-quote-14.jpg" alt="Y&#x27;ello? You&#x27;ll have to speak up. I&#x27;m wearing a towel.">\n<em>Bart Gets Famous - S05E12</em></p>\n<p><img src="/images/the-simpsons-quote-15.jpg" alt="If a cow ever got the chance, he&#x27;d eat you and everyone you care about.">\n<em>Lisa the Vegetarian - S07E05</em></p>\n<p><img src="/images/the-simpsons-quote-16.jpg" alt="Nothing you say can upset us. We&#x27;re the MTV generation.">\n<em>Homer\'s Triple Bypass - S04E11</em></p>\n<p><img src="/images/the-simpsons-quote-17.jpg" alt="Are You hyperventilating? No, I just like to smell my lunch.">\n<em>Lisa\'s Rival - S06E02</em></p>\n<p><img src="/images/the-simpsons-quote-18.jpg" alt="Can&#x27;t we have one meeting that doesn&#x27;t end up with us digging up a corpse?">\n<em>Lisa the Iconoclast - S07E16</em></p>\n<p><img src="/images/the-simpsons-quote-19.jpg" alt="There&#x27;s something about flying a kite at night that&#x27;s so unwholesome.">\n<em>The PTA Disbands - S06E21</em></p>\n<p><img src="/images/the-simpsons-quote-20.jpg" alt="Ralph, Jesus did not have wheels.">\n<em>Bart\'s Girlfriend - S06E07</em></p>\n<p><img src="/images/the-simpsons-quote-21.jpg" alt="Just because I don&#x27;t care doesn&#x27;t mean I don&#x27;t understand.">\n<em>Lisa\'s Substitute - S02E19</em></p>',timeToRead:1}},{node:{frontmatter:{title:"Gotta Catch ‘Em All (again)",tags:["entertainment","tv","pokemon","family","personal"],cover:"/images/pokemon-banner.jpg",date:"2018-05-29T21:49",author:"eddie"},fields:{slug:"/gotta-catch-em-all-again"},html:'<p>After introducing Ethan to Pokémon a couple of months ago, this morning we finished rewatching the 82 episode strong first season. It’s surprising how well a children’s TV show from 1997 still holds up today. A lot of it will be nostalgia for me; but Ethan is watching it as a child for the first time over 20 years after its debut - and he loves it.</p>\n<p><img src="/images/pokemon-ethan-book.jpg" alt="Ethan with my old Pokémon book"></p>\n<p>Over the last couple of months he has become obsessed with Pokémon; our house is slowly filling with toys, books, cards, clothes, and a mass of other Pokémon merchandise. It’s really surprising how quickly he’s learnt the names of all the Pokémon, much quicker than learning the far fewer letters of the alphabet a few years previous.</p>\n<p>Its going to be great fun when he’s old enough to play the games; lets see if he can beat me in battle on Pokémon Red and Blue. But for now we’ll stick with the TV show; next up is the emotional rollercoaster of <a href="https://www.imdb.com/title/tt0190641/">Pokémon: The First Movie - Mewtwo Strikes Back</a>.</p>\n<p><img src="/images/pokemon-movie-still.jpg" alt="Pokémon: The First Movie - Mewtwo Strikes Back"></p>',timeToRead:1}}],page:1,pages:10,total:49,limit:5,next:"/2"}}}});
